export default class extends React.Component {
  static async
  render() {
    return (
      <div>
        <header>Podcasts</header>

        <img src="/static/platzi-logo.png" alt="Platzi" />

        <style jsx>{`
          header {
            color: #fff;
            background: #8756ca;
            padding: 15px;
            text-align: center;
          }
        `}</style>

          <style jsx global>{`
            body {
              background: white;
            }
          `}</style>
      </div>
    )
  }
}
